import PropTypes from 'prop-types';
import React, { Component } from 'react';
import Header from './Header';

class PlayGame extends Component {
  render() {
    return (
      <div>
        <Header />
      </div>
    );
  }
}

PlayGame.propTypes = {
  token: PropTypes.function,
}.isRequired;

export default PlayGame;
